import React from "react";
const Product = () => {
  return (
    <div className="Product">
      <div className="lang-background">
        <Link to="/Home">
          <div className="btn-back">
            <img src={Back} alt="" />
          </div>
        </Link>
      </div>
    </div>
  );
};

export default Product;
